import React, { Image } from "react";
import logo from "./logo.svg";
import { ExplorerForm } from "./components/ExplorerForm";
import ExplorerGraph from "./components/ExplorerGraph";
import greenblack from "./resources/greenblack.png";

function App() {
  return (
    <div className="App" style={{ backgroundColor: "black" }}>
      <header className="App-header">
        <div
          style={{ display: "flex", flexDirection: "column", margin: "30px" }}
        >
          <div
            style={{
              height: "10%",
              width: "100%",
              display: "flex",
            }}
          >
            <img src={greenblack} />
          </div>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              height: "90%",
              width: "100%",
            }}
          >
            <div style={{ width: "50%" }}>
              <ExplorerGraph />
            </div>
            <div style={{ width: "50%" }}>
              <ExplorerForm />
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
